import React from 'react';

const ItemDetailContainer = () => {
    return (
        <div style={{ textAlign: "center", marginTop: "20px" }}>
            <h2>Item Details</h2>
            <p>Details will be displayed here.</p>
        </div>
    );
};

export default ItemDetailContainer;
